import { useEffect, useState } from "react";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";
import chargingImg from "../assets/icons/charging.png";
import scooterImg from "../assets/icons/scooter.png";
import parkingImg from "../assets/icons/parking.png";
import L from "leaflet";
import "leaflet/dist/leaflet.css";
import "../assets/css/map.css";

const chargingIcon = new L.Icon({
  iconUrl: chargingImg,
  iconSize: [50, 50],
  iconAnchor: [16, 32],
  popupAnchor: [0, -32],
});

const scooterIcon = new L.Icon({
  iconUrl: scooterImg,
  iconSize: [32, 32],
  iconAnchor: [16, 32],
  popupAnchor: [0, -32],
});

const parkingIcon = new L.Icon({
  iconUrl: parkingImg,
  iconSize: [50, 50],
  iconAnchor: [16, 32],
  popupAnchor: [0, -32],
});

// Leaflet icon fix
delete (L.Icon.Default.prototype as any)._getIconUrl;
L.Icon.Default.mergeOptions({
  iconUrl: "https://unpkg.com/leaflet@1.7.1/dist/images/marker-icon.png",
  shadowUrl: "https://unpkg.com/leaflet@1.7.1/dist/images/marker-shadow.png",
});

interface Station {
  id: number;
  name: string;
  latitude: number;
  longitude: number;
}

interface ParkingZone {
  id: number;
  name: string;
  latitude: number;
  longitude: number;
  radius: number;
}

interface Scooter {
  id: number;
  serial_number: string;
  current_latitude: number;
  current_longitude: number;
  status: string;
}

const MapView = () => {
  const [mounted, setMounted] = useState(false);
  const [stations, setStations] = useState<Station[]>([]);
  const [zones, setZones] = useState<ParkingZone[]>([]);
  const [scooters, setScooters] = useState<Scooter[]>([]);

  useEffect(() => {
    setMounted(true);

    const fetchData = async () => {
      const headers = {
        Authorization: `Bearer ${localStorage.getItem("jwt")}`,
      };

      try {
        const [stationRes, zoneRes, scooterRes] = await Promise.all([
          fetch("http://localhost:5000/v1/chargingstations", { headers }),
          fetch("http://localhost:5000/v1/parking"),
          fetch("http://localhost:5000/v1/bikes"),
        ]);

        const stationsData = await stationRes.json();
        const zonesData = await zoneRes.json();
        const scootersData = await scooterRes.json();

        setStations(stationsData.stations ?? []);
        setZones(zonesData.parkings ?? []);
        setScooters(scootersData.scooters ?? []);
      } catch (err) {
        console.error("Error fetching data", err);
      }
    };

    fetchData();
  }, []);

  if (!mounted || typeof window === "undefined") return <div>Loading map...</div>;

  return (
    <div className="map-wrapper">
      <div className="map-content">
        <h2 className="map-title">Karta över Stockholm</h2>
        <MapContainer center={[59.3293, 18.0686]} zoom={13} className="leaflet-container">
          <TileLayer
            attribution='&copy; OpenStreetMap contributors'
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          />

          {stations.map((station) => (
            <Marker
              key={`station-${station.id}`}
              position={[station.latitude, station.longitude]}
              icon={chargingIcon}
            >
              <Popup>
                <strong>Laddstation</strong><br />
                {station.name}
              </Popup>
            </Marker>
          ))}

          {zones.map((zone) => (
            <Marker
              key={`zone-${zone.id}`}
              position={[zone.latitude, zone.longitude]}
              icon={parkingIcon}
            >
              <Popup>
                <strong>Parkering</strong><br />
                {zone.name}
              </Popup>
            </Marker>
          ))}

          {scooters.map((scooter) => (
            <Marker
              key={`scooter-${scooter.id}`}
              position={[scooter.current_latitude, scooter.current_longitude]}
              icon={scooterIcon}
            >
              <Popup>
                <strong>Scooter</strong><br />
                Serial: {scooter.serial_number}<br />
                Status: {scooter.status}
              </Popup>
            </Marker>
          ))}
        </MapContainer>
      </div>
    </div>
  );
};

export default MapView;
